    "instructions": "Instructions\n\nTake the entire package of OREO Cookies (filling and all) and crush them in a large gallon ziplock bag.\n\nEmpty cookie crumbs into large mixing bowl.\n\nPlace cream cheese in large mixing bowl.\n\nMix well on medium speed.\n\nUse a 1\" cookie scoop and create round balls with palms of hands. Place on a cookie sheet.\n\nPlace cookie balls in freezer for about 10 minutes.\n\nMelt Baker's Chocolate per instructions.\n\nDip Cookie Balls into chocolate and then place on a wax paper covered cookie sheet. Place in the refrigerator for an hour to harden.\n\nTo Make Snowman:\n\nTake icing and dab a bit on a Rolo candy and place on the top of the cookie ball. Use the gel icing to create eyes, nose, and mouth. Add a dab of icing to snowflake and attach to the Rolo for decoration.",
