    "summary": "Chicken Cordon Bleu might be just the main course you are searching for. This recipe serves 6 and costs $2.12 per serving. One serving contains <b>496 calories</b>, <b>49g of protein</b>, and <b>26g of fat</b>. Several people made this recipe, and 161 would say it hit the spot. A mixture of deli ham, chicken breasts, olive oil, and a handful of other ingredients are all it takes to make this recipe so yummy. To use up the flour you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-tart-with-caramel-sauce-47961\">Apple Tart with Caramel Sauce</a> as a dessert. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 84%</b>. This score is super. Try <a href=\"https://spoonacular.com/recipes/chicken-cordon-bleu-320142\">Chicken Cordon Bleu</a>, <a href=\"https://spoonacular.com/recipes/chicken-cordon-bleu-74241\">Chicken Cordon Bleu</a>, and <a href=\"https://spoonacular.com/recipes/chicken-cordon-bleu-558701\">Chicken Cordon Bleu</a> for similar recipes.",
