    "summary": "Focaccia with Tomato, Green Onion and Garlic might be just the bread you are searching for. This recipe makes 8 servings with <b>317 calories</b>, <b>8g of protein</b>, and <b>8g of fat</b> each. For <b>43 cents per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up warm water, quick-rising yeast, oregano, and a few other things to make it today. Only a few people made this recipe, and 6 would say it hit the spot. This recipe is typical of Mediterranean cuisine. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 76%</b>. This score is solid. Similar recipes include <a href=\"https://spoonacular.com/recipes/red-onion-garlic-focaccia-38558\">Red Onion & Garlic Focaccia</a>, <a href=\"https://spoonacular.com/recipes/red-onion-and-garlic-focaccia-38586\">Red Onion And Garlic Focaccia</a>, and <a href=\"https://spoonacular.com/recipes/garlic-onion-focaccia-389797\">Garlic Onion Focaccia</a>.",
