    "summary": "Carrot Quinoa Muffins is a <b>lacto ovo vegetarian</b> breakfast. One portion of this dish contains around <b>6g of protein</b>, <b>19g of fat</b>, and a total of <b>297 calories</b>. This recipe serves 12. For <b>74 cents per serving</b>, this recipe <b>covers 10%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 28 foodies and cooks. It is brought to you by Foodista. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. Head to the store and pick up allspice, dark brown sugar, vanilla, and a few other things to make it today. Taking all factors into account, this recipe <b>earns a spoonacular score of 46%</b>, which is pretty good. Similar recipes include <a href=\"https://spoonacular.com/recipes/quinoa-carrot-muffins-585490\">Quinoa-Carrot Muffins</a>, <a href=\"https://spoonacular.com/recipes/carrot-quinoa-muffins-720587\">Carrot Quinoa Muffins</a>, and <a href=\"https://spoonacular.com/recipes/carrot-quinoa-muffins-487842\">Carrot Quinoa Muffins</a>.",
