    "summary": "The recipe 10 Minute Brownies is ready <b>in approximately 45 minutes</b> and is definitely an amazing <b>dairy free</b> option for lovers of American food. This recipe makes 16 servings with <b>201 calories</b>, <b>2g of protein</b>, and <b>12g of fat</b> each. For <b>29 cents per serving</b>, this recipe <b>covers 4%</b> of your daily requirements of vitamins and minerals. A mixture of applesauce, finely-chopped walnuts, semisweet chocolate chips, and a handful of other ingredients are all it takes to make this recipe so scrumptious. 64 people have made this recipe and would make it again. It works well as a cheap dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 23%</b>. This score is not so excellent. Try <a href=\"https://spoonacular.com/recipes/healthy-two-minute-brownies-703516\">healthy two minute brownies</a>, <a href=\"https://spoonacular.com/recipes/5-minute-espresso-walnut-brownies-500799\">5 Minute Espresso Walnut Brownies</a>, and <a href=\"https://spoonacular.com/recipes/easy-dijon-tarragon-tilapia-5-minute-prep-in-morning-20-minute-bake-at-dinner-504354\">Easy Dijon Tarragon Tilapia – 5 minute prep in morning, 20 minute bake at dinner</a> for similar recipes.",
