    "instructions": "<ol><li>Preheat oven to 350 degrees F. Lightly oil a 6 x 9 inch baking pan and set aside.</li><li>In a small saucepan over low heat, combine the oil and chocolate chips, stirring occasionally until melted. Remove from heat and set aside.</li><li>To a large bowl, add the applesauce, sugar and vanilla. Blend well. Stir in the chocolate mixture. Whip and blend well. Add the flour, baking powder and walnuts, and mix just to combine. Spoon the batter into the baking pan. Bake for 25 to 30 minutes or until the top springs back when lightly touched. Be careful not to overbake the brownies or they will be dry. Let cool completely before cutting into squares. Store in a covered, airtight container in the refrigerator.</li></ol>",
