    "summary": "If you have about <b>about 45 minutes</b> to spend in the kitchen, Creamy Shrimp Bisque might be an amazing <b>pescatarian</b> recipe to try. This main course has <b>495 calories</b>, <b>30g of protein</b>, and <b>28g of fat</b> per serving. For <b>$3.37 per serving</b>, this recipe <b>covers 28%</b> of your daily requirements of vitamins and minerals. This recipe serves 4. This recipe is liked by 10 foodies and cooks. A mixture of shrimp, green onions, cayenne pepper, and a handful of other ingredients are all it takes to make this recipe so delicious. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 61%</b>, which is good. If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/creamy-shrimp-bisque-307546\">Creamy Shrimp Bisque</a>, <a href=\"https://spoonacular.com/recipes/shrimp-bisque-85411\">Shrimp Bisque</a>, and <a href=\"https://spoonacular.com/recipes/shrimp-bisque-248913\">Shrimp Bisque</a>.",
