    "image": "https://spoonacular.com/recipeImages/715562-556x370.jpg",
    "imageType": "jpg",
    "summary": "You can never have too many main course recipes, so give Loaded Baked Potato Soup a try. One portion of this dish contains around <b>23g of protein</b>, <b>37g of fat</b>, and a total of <b>652 calories</b>. This recipe serves 8. For <b>$1.48 per serving</b>, this recipe <b>covers 24%</b> of your daily requirements of vitamins and minerals. 5744 people have tried and liked this recipe. This recipe from Pink When requires white onion, baking potatoes, butter, and flour. <b>Winter</b> will be even more special with this recipe. From preparation to the plate, this recipe takes approximately <b>1 hour</b>. With a spoonacular <b>score of 93%</b>, this dish is awesome. Try <a href=\"https://spoonacular.com/recipes/loaded-baked-potato-soup-with-crispy-fried-potato-skins-650231\">Loaded Baked Potato Soup with Crispy-Fried Potato Skins</a>, <a href=\"https://spoonacular.com/recipes/loaded-baked-potato-soup-475622\">Loaded Baked Potato Soup</a>, and <a href=\"https://spoonacular.com/recipes/loaded-baked-potato-soup-530832\">Loaded Baked Potato Soup</a> for similar recipes.",
