    "summary": "Spicy Lemongrass Soup requires roughly <b>about 45 minutes</b> from start to finish. This dairy free, lacto ovo vegetarian, and vegan recipe serves 4 and costs <b>$2.94 per serving</b>. One serving contains <b>245 calories</b>, <b>7g of protein</b>, and <b>8g of fat</b>. 13 people have tried and liked this recipe. A couple people really liked this soup. Head to the store and pick up , snow peas, tofu cubes, and a few other things to make it today. <b>Autumn</b> will be even more special with this recipe. It is brought to you by Foodista. All things considered, we decided this recipe <b>deserves a spoonacular score of 67%</b>. This score is good. Similar recipes include <a href=\"https://spoonacular.com/recipes/spicy-lemongrass-crab-46854\">Spicy Lemongrass Crab</a>, <a href=\"https://spoonacular.com/recipes/spicy-lemongrass-chicken-wings-526334\">Spicy Lemongrass Chicken Wings</a>, and <a href=\"https://spoonacular.com/recipes/spicy-mussels-with-ginger-and-lemongrass-42117\">Spicy Mussels with Ginger and Lemongrass</a>.",
