    "imageType": "jpg",
    "summary": "How to Make the Perfect Sweet Potato Sloppy Joes might be just the <b>American</b> recipe you are searching for. One portion of this dish contains roughly <b>46g of protein</b>, <b>7g of fat</b>, and a total of <b>407 calories</b>. For <b>$3.99 per serving</b>, you get a main course that serves 4. 10 people have tried and liked this recipe. Head to the store and pick up salt and pepper, water, ground turkey, and a few other things to make it today. It is a good option if you're following a <b>gluten free, dairy free, paleolithic, and primal</b> diet. From preparation to the plate, this recipe takes around <b>40 minutes</b>. It is brought to you by Pink When. Overall, this recipe earns a <b>solid spoonacular score of 50%</b>. Similar recipes are <a href=\"https://spoonacular.com/recipes/just-perfect-sloppy-joes-82826\">Just Perfect Sloppy Joes</a>, <a href=\"https://spoonacular.com/recipes/how-to-make-classic-sloppy-joes-471307\">How to Make Classic Sloppy Joes</a>, and <a href=\"https://spoonacular.com/recipes/make-ahead-sloppy-joes-428874\">Make-Ahead Sloppy Joes</a>.",
