    "summary": "Crab Cake Stuffed Shrimp requires about <b>approximately 45 minutes</b> from start to finish. This recipe makes 24 servings with <b>91 calories</b>, <b>4g of protein</b>, and <b>6g of fat</b> each. For <b>55 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista has 6 fans. It is a good option if you're following a <b>pescatarian</b> diet. It works well as a hor d'oeuvre. A mixture of round buttery crackers, ground pepper, garlic, and a handful of other ingredients are all it takes to make this recipe so flavorful. Taking all factors into account, this recipe <b>earns a spoonacular score of 15%</b>, which is not so excellent. <a href=\"https://spoonacular.com/recipes/crab-stuffed-shrimp-244924\">Crab Stuffed Shrimp</a>, <a href=\"https://spoonacular.com/recipes/crab-stuffed-shrimp-11095\">Crab Stuffed Shrimp</a>, and <a href=\"https://spoonacular.com/recipes/crab-shrimp-stuffed-sole-443126\">Crab & Shrimp Stuffed Sole</a> are very similar to this recipe.",
