    "summary": "The recipe Vegetarian Spring Rolls With Garlic Lime Sauce is ready <b>in about 45 minutes</b> and is definitely a spectacular <b>gluten free, dairy free, and fodmap friendly</b> option for lovers of Vietnamese food. This hor d'oeuvre has <b>133 calories</b>, <b>3g of protein</b>, and <b>1g of fat</b> per serving. This recipe serves 10 and costs 71 cents per serving. 10 people were impressed by this recipe. It is perfect for <b>Spring</b>. Head to the store and pick up butter leaf lettuce, vegetarian spring roll, saracha, and a few other things to make it today. All things considered, we decided this recipe <b>deserves a spoonacular score of 75%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/gluten-free-vegetarian-spring-rolls-with-thai-style-peanut-sauce-644859\">Gluten Free Vegetarian Spring Rolls With Thai-Style Peanut Sauce</a>, <a href=\"https://spoonacular.com/recipes/tuna-spring-rolls-with-lime-soy-sauce-89688\">Tuna Spring Rolls With Lime/soy Sauce</a>, and <a href=\"https://spoonacular.com/recipes/shrimp-spring-rolls-with-peanut-lime-dipping-sauce-5-points-548665\">Shrimp Spring Rolls with Peanut Lime Dipping Sauce – 5 Points</a> for similar recipes.",
