    "summary": "The recipe Ginger-Lemon Panna Cotta with Brandied Berry Sauce could satisfy your Mediterranean craving in about <b>approximately 45 minutes</b>. One portion of this dish contains around <b>5g of protein</b>, <b>26g of fat</b>, and a total of <b>413 calories</b>. For <b>$2.88 per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. This recipe serves 6. 9 people found this recipe to be delicious and satisfying. This recipe from Foodista requires blueberries, vegetable oil, granulated sugar, and lemon juice. It is a good option if you're following a <b>gluten free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 27%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/lemon-ginger-panna-cotta-cheesecake-+-blueberry-sauce-607508\">lemon ginger panna cotta cheesecake + blueberry sauce</a>, <a href=\"https://spoonacular.com/recipes/lemon-panna-cotta-with-berry-compote-231584\">Lemon Panna Cotta with Berry Compote</a>, and <a href=\"https://spoonacular.com/recipes/panna-cotta-with-berry-sauce-605337\">Panna Cotta with Berry Sauce</a> for similar recipes.",
