    "summary": "Plantain Toffee Balls might be just the side dish you are searching for. One serving contains <b>413 calories</b>, <b>3g of protein</b>, and <b>20g of fat</b>. This vegetarian recipe serves 2 and costs <b>77 cents per serving</b>. 14 people were impressed by this recipe. From preparation to the plate, this recipe takes about <b>45 minutes</b>. A mixture of butter, vanilla, coconut milk, and a handful of other ingredients are all it takes to make this recipe so delicious. All things considered, we decided this recipe <b>deserves a spoonacular score of 31%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/juj-green-plantain-and-cheese-balls-629173\">Jujú (Green Plantain and Cheese Balls)</a>, <a href=\"https://spoonacular.com/recipes/ripe-plantain-balls-buuelos-de-pltano-maduro-226285\">Ripe Plantain Balls (Buñuelos de Plátano Maduro)</a>, and <a href=\"https://spoonacular.com/recipes/cacao-coconut-plantain-rice-balls-with-pepitas-563942\">Cacao-Coconut Plantain Rice Balls with Pepitas</a> for similar recipes.",
