    "summary": "Chicken Porridge might be just the morn meal you are searching for. This recipe makes 4 servings with <b>392 calories</b>, <b>28g of protein</b>, and <b>6g of fat</b> each. For <b>$2.18 per serving</b>, this recipe <b>covers 25%</b> of your daily requirements of vitamins and minerals. A few people made this recipe, and 19 would say it hit the spot. Head to the store and pick up carrot, rice, vegetable oil, and a few other things to make it today. It is a good option if you're following a <b>gluten free and dairy free</b> diet. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 85%</b>. This score is awesome. Try <a href=\"https://spoonacular.com/recipes/korean-dak-juk-chicken-porridge-649045\">Korean Dak Juk (Chicken Porridge)</a>, <a href=\"https://spoonacular.com/recipes/chicken-and-leek-porridge-637904\">Chicken and Leek Porridge</a>, and <a href=\"https://spoonacular.com/recipes/chicken-congee-rice-porridge-233690\">Chicken Congee (Rice Porridge)</a> for similar recipes.",
