    "summary": "Mozzarella Sticks might be just the hor d'oeuvre you are searching for. For <b>$10.35 per serving</b>, this recipe <b>covers 45%</b> of your daily requirements of vitamins and minerals. One serving contains <b>1773 calories</b>, <b>104g of protein</b>, and <b>98g of fat</b>. Head to the store and pick up flour, water, eggs, and a few other things to make it today. A couple people made this recipe, and 11 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 83%</b>. This score is great. Try <a href=\"https://spoonacular.com/recipes/mozzarella-sticks-296374\">Mozzarella Sticks</a>, <a href=\"https://spoonacular.com/recipes/mozzarella-sticks-675804\">Mozzarella Sticks</a>, and <a href=\"https://spoonacular.com/recipes/mozzarella-sticks-79012\">Mozzarella Sticks</a> for similar recipes.",
