    "instructions": "<ol><li>Dice 1/4 of the pear into 1/4 cubes and place in rocks glass with huckleberry liqueur, mint and brandy. Stir to combine. Cut another 1/4 of pear into large chunks. Put in shaker and add bitters and pear-cardamom syrup. Muddle until pear is completely broken down. Add rum, lemon juice, ginger juice and egg white. Fill with ice and shake for 30 seconds. Add ice cubes to rocks glass with pear cubes. Strain cocktail into glass and garnish by standing a paper-thin slice of pear in froth.</li><li>To make the Pear-Cardamom Syrup:</li><li>Bring sugar and water to boil in small pot. Remove from heat and add pear and cardamom.</li><li>Cover and let sit for 20 minutes. Strain and chill.</li></ol>",
