    "summary": "You can never have too many morn meal recipes, so give Blueberry Banana Pancakes a try. This recipe serves 2 and costs $2.29 per serving. Watching your figure? This vegetarian recipe has <b>594 calories</b>, <b>17g of protein</b>, and <b>2g of fat</b> per serving. If you have vanillan extract, banana, pastry flour, and a few other ingredients on hand, you can make it. A couple people made this recipe, and 25 would say it hit the spot. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 65%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/blueberry-banana-pancakes-51549\">Blueberry-banana Pancakes</a>, <a href=\"https://spoonacular.com/recipes/blueberry-banana-pancakes-51632\">Blueberry-Banana Pancakes</a>, and <a href=\"https://spoonacular.com/recipes/banana-blueberry-pancakes-534677\">Banana Blueberry Pancakes</a> for similar recipes.",
