    "imageType": "jpg",
    "summary": "Grilled Lemon Garlic Artichokes is a <b>caveman, gluten free, primal, and whole 30</b> side dish. For <b>$1.15 per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. This recipe makes 4 servings with <b>200 calories</b>, <b>3g of protein</b>, and <b>18g of fat</b> each. Head to the store and pick up kosher salt, thyme leaves, herbs such as rosemary, and a few other things to make it today. It can be enjoyed any time, but it is especially good for <b>The Fourth Of July</b>. Only a few people made this recipe, and 9 would say it hit the spot. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 69%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/grilled-baby-artichokes-with-lemon-and-garlic-28484\">Grilled Baby Artichokes With Lemon And Garlic</a>, <a href=\"https://spoonacular.com/recipes/lemon-garlic-grilled-artichokes-with-easy-aioli-28585\">Lemon Garlic Grilled Artichokes With Easy Aioli</a>, and <a href=\"https://spoonacular.com/recipes/garlic-grilled-artichokes-109001\">Garlic Grilled Artichokes</a> for similar recipes.",
