    "summary": "Zucchini Flutes Piped With Basil Ricotta Mousse is a side dish that serves 4. Watching your figure? This gluten free and primal recipe has <b>234 calories</b>, <b>14g of protein</b>, and <b>17g of fat</b> per serving. For <b>$1.0 per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up extra virgin olive oil, basil leaves - torn, parmesan cheese, and a few other things to make it today. 7 people found this recipe to be yummy and satisfying. It is brought to you by Foodista. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 54%</b>, which is pretty good. Try <a href=\"https://spoonacular.com/recipes/zucchini-with-ricotta-mint-and-basil-597937\">Zucchini with Ricotta, Mint, and Basil</a>, <a href=\"https://spoonacular.com/recipes/fried-zucchini-blossoms-stuffed-with-basil-ricotta-606463\">Fried Zucchini Blossoms Stuffed with Basil Ricotta</a>, and <a href=\"https://spoonacular.com/recipes/grilled-zucchini-rollups-stuffed-with-lemon-basil-ricotta-and-slow-roasted-tomatoes-915698\">Grilled Zucchini Rollups Stuffed with Lemon-Basil Ricottan and Slow Roasted Tomatoes</a> for similar recipes.",
