    "summary": "This recipe serves 20 and costs 48 cents per serving. One serving contains <b>214 calories</b>, <b>2g of protein</b>, and <b>18g of fat</b>. If you have cream cheese, oreo cookies, lemon juice, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>vegetarian</b> diet. 123 people have made this recipe and would make it again. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 15%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/cookies-and-cream-cheesecake-cupcakes-aka-oreo-cheesecake-cupcakes-543602\">Cookies and Cream Cheesecake Cupcakes {akan Oreo Cheesecake Cupcakes}</a>, <a href=\"https://spoonacular.com/recipes/no-bake-cookies-n-cream-cheesecake-538962\">No Bake Cookies n Cream Cheesecake</a>, and <a href=\"https://spoonacular.com/recipes/no-bake-oreo-cheesecake-547808\">No Bake Oreo Cheesecake</a> for similar recipes.",
