    "summary": "Chili Pie with Green Chile and Cheddar Cornbread Crust might be just the <b>Southern</b> recipe you are searching for. For <b>$2.41 per serving</b>, this recipe <b>covers 28%</b> of your daily requirements of vitamins and minerals. One serving contains <b>702 calories</b>, <b>36g of protein</b>, and <b>40g of fat</b>. From preparation to the plate, this recipe takes about <b>1 hour</b>. It is perfect for <b>The Super Bowl</b>. This recipe from Foodista has 15 fans. A mixture of paprika, chile powder, kosher salt and pepper, and a handful of other ingredients are all it takes to make this recipe so scrumptious. All things considered, we decided this recipe <b>deserves a spoonacular score of 73%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/green-chile-cornbread-246379\">Green Chile Cornbread</a>, <a href=\"https://spoonacular.com/recipes/green-chile-cornbread-518683\">Green Chile Cornbread</a>, and <a href=\"https://spoonacular.com/recipes/cheddar-chili-cornbread-pie-609897\">Cheddar Chili Cornbread Pie</a> for similar recipes.",
