    "summary": "The recipe Asian Salmon Burgers With Tangy Ginger Lime Sauce is ready <b>in roughly 30 minutes</b> and is definitely a spectacular <b>pescatarian</b> option for lovers of American food. One serving contains <b>564 calories</b>, <b>28g of protein</b>, and <b>40g of fat</b>. For <b>$3.7 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. A couple people really liked this main course. This recipe is liked by 18 foodies and cooks. Head to the store and pick up oyster sauce, juice of lime, mayonnaise, and a few other things to make it today. To use up the sour cream you could follow this main course with the <a href=\"https://spoonacular.com/recipes/sour-cream-apple-pie-70374\">Sour Cream Apple Pie</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 77%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/asian-turkey-burgers-with-sriracha-lime-yogurt-sauce-510571\">Asian Turkey Burgers with Sriracha Lime Yogurt Sauce</a>, <a href=\"https://spoonacular.com/recipes/asian-coconut-rice-with-steamed-vegetables-in-soy-lime-ginger-sauce-612309\">Asian Coconut Rice with Steamed Vegetables in Soy-Lime-Ginger Sauce</a>, and <a href=\"https://spoonacular.com/recipes/crispy-asian-chicken-wings-with-ginger-lime-dipping-sauce-595560\">Crispy Asian Chicken Wings with Ginger-Lime Dipping Sauce</a> for similar recipes.",
