    "summary": "One serving contains <b>1147 calories</b>, <b>13g of protein</b>, and <b>63g of fat</b>. This recipe serves 8 and costs $2.8 per serving. 60 people were impressed by this recipe. It will be a hit at your <b>Easter</b> event. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. A mixture of baking powder, vanillan extract, pecans, and a handful of other ingredients are all it takes to make this recipe so tasty. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 59%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/carrot-cake-with-cream-cheese-frosting-61609\">Carrot Cake With Cream Cheese Frosting</a>, <a href=\"https://spoonacular.com/recipes/carrot-cake-with-cream-cheese-frosting-544693\">Carrot Cake with Cream Cheese Frosting</a>, and <a href=\"https://spoonacular.com/recipes/raw-carrot-cake-with-cream-cheese-frosting-482975\">Raw Carrot Cake With Cream Cheese Frosting</a> for similar recipes.",
