    "instructions": "<ol><li>Soak raisins in rum, preferably overnight, until raisins are nice and plump.</li><li>Preheat the oven to 325. Butter two 9-inch cake pans; line the bottoms with parchment. Butter the paper and flour the pans.</li><li>For the cake:</li><li>Spread the pecans on a baking sheet and toast for 8 minutes, until fragrant. Cool and finely chop.</li><li>In a bowl, whisk the flour, baking powder, baking soda, cinnamon and salt.</li><li>In a small bowl, whisk the oil, buttermilk and vanilla.</li><li>In a large bowl, using an electric mixer, beat the eggs and sugar at high speed until pale, 5 minutes.</li><li>Beat in the liquid ingredients, then beat in the dry ingredients just until moistened.</li><li>Stir in the carrots, pecans and raisins.</li><li>Divide the batter between the pans and bake the cakes for 55 minutes to 1 hour, until springy and golden.</li><li>Let the cakes cool on a rack for 30 minutes, then unmold the cakes and let cool completely.</li><li>For the Frosting:</li><li>In a large bowl, using an electric mixer, beat the butter and cream cheese at high speed until light, about 5 minutes.</li><li>Beat in the vanilla and orange zest, then the confectioners' sugar; beat at low speed until incorporated. Increase the speed to high and beat until light and fluffy, about 3 minutes.</li><li>Peel off the parchment paper and invert one cake layer onto a plate. Spread with a slightly rounded cup of the frosting. Top with the second cake layer, right side up. Spread the top and sides with the remaining frosting and refrigerate the cake until chilled, about 1 hour.</li></ol>",
